import React, {Component} from "react";
import '../tabata.css';
import Row from "react-bootstrap/Row";

class Exercise extends Component {
    render() {
        return(
            <div>
                <div className="text-center col-10">
                    <h1>Tu tabata</h1>
                    <div className="card-body">
                        <h4 className="card-title border-info">Vueltas:</h4><p>8</p>
                        <h4 className="card-title">Tiempo de trabajo:</h4>
                         <div className="form-group">
                                        <label htmlFor="exampleFormControlSelect1">Tiempo de trabajo:</label>
                                        <select className="form-control" id="exampleFormControlSelect1">
                                            <option>1</option>
                                            <option>2</option>
                                            <option>3</option>
                                            <option>4</option>
                                            <option>5</option>
                                        </select>
                                  </div>
                    </div>
                    <div className="card-body">
                        <h4 className="card-title">Tiempo de descanso:</h4><p>60seg</p>
                        <h4 className="card-title">Tiempo de espera:</h4><p>10seg</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default Exercise;
